import React from "react";
import { SwContext } from "../swContex";

function Table() {
    return(
        <SwContext.Provider>
            { ({
                data,
                coluna,
                operador,
                operando,
                ordenador,
                ordem,
                }) => {console.log(data)}}
                <table>
                     <tr>
                       <th>Name</th>
                       <th>Rotation Period</th>
                       <th>Orbital Pedriod</th>
                       <th>Diameter</th>
                       <th>Climate</th>
                       <th>GravitY</th>
                       <th>Terrain</th>
                       <th>Surfece Water</th>
                       <th>Population</th>
                       <th>Films</th>
                       <th>Cread</th>
                       <th>Edited</th>
                       <th>URL</th>
                     </tr>
                   </table>
        </SwContext.Provider>
    );
}

export default Table;
